package c2.哈希;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.HashSet;
import java.util.List;

/*
暴力解法，就是枚举长度是words的总长度的字串是不是符合条件
如何比较2个map相同？key相同，value也相同
 */
public class P30SubstringWithConcatenationsOfAllWords {
    public List<Integer> findSubstring(String s, String[] words) {
        int tot = 0;
        HashMap<String, Integer> wordMap = new HashMap<>();

        for (String word : words) {
            tot += word.length();
            wordMap.put(word, wordMap.getOrDefault(word, 0) + 1);
        }

        List<Integer> ans = new ArrayList();
        for (int i = 0; i + tot <= s.length(); i++) {
            if (valid(s.substring(i, i + tot), words, wordMap))
                ans.add(i);
        }

        return ans;
    }

    boolean valid(String str, String[] words, HashMap<String, Integer> wordMap) {
        int k = words[0].length();
        HashMap<String, Integer> splitWordmap = new HashMap<>();
        for (int i = 0; i <= str.length() - k; i = i + k) {

            splitWordmap.put(str.substring(i, i + k), splitWordmap.getOrDefault(str.substring(i, i + k), 0) + 1);
        }
        return equalMap(splitWordmap, wordMap);
    }

    //key and value都相等
    boolean equalMap(HashMap<String, Integer> splitWordMap, HashMap<String, Integer> wordMap) {

        for (String key : splitWordMap.keySet()) {
            System.out.println(!wordMap.containsKey(key));
            System.out.println(wordMap.get(key));
            System.out.println(splitWordMap.get(key));
            System.out.println(wordMap.get(key) != splitWordMap.get(key));
            System.out.println(!wordMap.get(key).equals(splitWordMap.get(key)));
            if (!wordMap.containsKey(key) || !wordMap.get(key).equals(splitWordMap.get(key)))
                return false;
        }

        for (String key : wordMap.keySet()) {
            if (!splitWordMap.containsKey(key) || !splitWordMap.get(key).equals(wordMap.get(key)))
                return false;
        }

        return true;
    }
}

